import React, { StatelessComponent } from 'react';
import { Container, Row, Col, Form } from 'react-bootstrap'

const Content: React.StatelessComponent = () => {
    return(

        <Container fluid>
          <Row>
            <Col sm={8}>Sidebar</Col>
            <Col sm={4}>Content</Col>
          </Row>
        </Container>

    );
};

export default Content;
